import { StyleSheet } from "react-native";  

const styles = StyleSheet.create({
    containerCart: {
        flexDirection: 'row',
        justifyContent: 'space-between',
    },
    item1: {
        width: '25%',
    },
    img: {
        width: '90%',
        height: 110,
        borderRadius: 10
    },
    item2: {
        width: '55%'
    },
    textName: {
        fontFamily: 'Inconsolata-Bold',
        fontSize: 18
    },
    textIngre: {
        fontFamily: 'Inconsolata-Medium',
        // fontSize: 16,
        color: '#7d7d80',
        lineHeight: 20,
        marginTop: 8
    },
    item3: {
        width: '20%'
    },
    imgShiper: {
        width: 24,
        height: 24
    }
});

export default styles;
